window.bookSummaryJSON = "<p>The complete military space opera series from best-selling author Scott Bartlett.</p> <p>Last time, the aliens smashed the galaxy.&nbsp;Humanity held on by the fingernails.&nbsp;</p> <p>In the decades since, we’ve put worlds back together.&nbsp;We’ve licked our wounds.&nbsp;But Captain Husher warned us they would return.&nbsp;</p> <p>We didn’t want to believe him. We couldn’t afford to believe him.&nbsp;</p> <p>Doesn’t matter. The enemy has returned, with weapons beyond anything we’ve dreamed of.&nbsp;</p> <p>Now, it falls to Husher and his troubled crew to save us.&nbsp;</p> <p>There's just one problem. First, he must save us from himself.&nbsp;</p> <p>Bundle contains:&nbsp;</p> <p></p> <ol> <li><i>Capital Starship&nbsp;</i></li> <li><i>Pride of the Fleet&nbsp;</i></li> <li><i>Dogs of War</i></li> </ol> <p>Sci-fi with a bold streak. Download this complete series today.&nbsp;&nbsp;</p>"; 
